INSERT INTO `tiki_pages` (`page_id`, `pageName`, `pageSlug`, `hits`, `data`, `description`, `lastModif`, `comment`, `version`, `version_minor`, `user`, `ip`, `flag`, `points`, `votes`, `cache`, `wiki_cache`, `cache_timestamp`, `pageRank`, `creator`, `page_size`, `lang`, `lockedby`, `is_html`, `created`, `wysiwyg`, `wiki_authors_style`, `comments_enabled`, `keywords`) VALUES
(1, 'HomePage', 'HomePage', 0, '!Felicidades\nEsta es la página de inicio por omisión para tu Tiki. Si estás viendo esta página, tu instalación se ha realizado con éxito..\n\nPuedes cambiar esta página después de conectarte. Por favor, revisa la [http://doc.tiki.org/wiki+syntax|sintaxis wiki] para los detalles de edición.\n\n\n!!Ponte en marcha.\nPara empezar a configurar tu sitio:\n{FANCYLIST()}\n1) Conéctate con la contraseña nueva que has creado.\n2) [tiki-admin.php?page=features|Habilita manualmente] algunas funcionalidades de Tiki concretas que no hayas habilitado aún con el asistente de administración.\n3) Ejecuta [tiki-admin.php?page=profiles|Perfiles de Configuración de Tiki] para ponerte en marcha de forma ágil.\n{FANCYLIST}\n\n!!Necesitas ayuda?\nPara más información:\n*[https://tiki.org/Introduction|Learn more about Tiki].\n*[https://tiki.org/|Get help], including the [http://doc.tiki.org|official documentation] and [http://tiki.org/forums|support forums].\n*[https://tiki.org/Join|Join the Tiki community].\n', '', 1465243375, 'Tiki initialization', 1, 0, 'admin', '0.0.0.0', '', NULL, NULL, NULL, NULL, NULL, NULL, 'admin', 1000, 'es', '', 0, 1465243375, 'n', '', NULL, NULL);
